import React from "react";
import {
  DataGrid,
  Button,
  Card,
  Checkbox,
  GridColDef,
  IconButton,
} from "intelli-ui-components-library";
import { AddIcon, CopyIcon, DeleteIcon } from "../../assets/icons";
import styles from "./server.module.scss";

const Server = () => {
  const rows = [{ url: "google.com", desc: "desc" }];
  const columns: GridColDef[] = [
    {
      field: "selected",
      displayName: "",
      description: "",
      sortable: false,
      renderCell: (row) => (
        <div style={{ width: "60px" }}>
          <Checkbox
            checked={row.selected}
            onChange={() => console.log(row.id)}
          />
        </div>
      ),
    },
    {
      field: "url",
      displayName: "URL",
      description: "",
      sortable: false,
      renderCell: (row) => <div style={{ width: "150px" }}>{row.url}</div>,
    },
    {
      field: "description",
      displayName: "Description",
      description: "",
      sortable: false,
      renderCell: (row) => (
        <div style={{ width: "150px" }}>{row.description}</div>
      ),
    },
  ];
  const headerColumns: GridColDef[] = [
    {
      field: "selected",
      displayName: "",
      description: "",
      sortable: false,
      renderCell: (row) => (
        <div style={{ width: "60px" }}>
          <Checkbox
            checked={row.selected}
            onChange={() => console.log(row.id)}
          />
        </div>
      ),
    },
    {
      field: "url",
      displayName: "URL",
      description: "",
      sortable: false,
      renderCell: () => <div style={{ width: "150px" }}>URL</div>,
    },
    {
      field: "description",
      displayName: "Description",
      description: "",
      sortable: false,
      renderCell: () => <div style={{ width: "150px" }}>Description</div>,
    },
  ];
  return (
    <div>
      <h1 className={styles["section-title"]}>Server</h1>
      <Card className={styles["card"]}>
        <div className={styles["title-section"]}>
          <div>
            <h3>All Servers </h3>
            <h5>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Mollitia,
              molestias
            </h5>
          </div>
          <div className={styles["button-group"]}>
            <Button variant="outline" className={styles["buttons"]}>
              <CopyIcon /> DUPLICATE
            </Button>
            <Button variant="outline" className={styles["buttons"]}>
              <DeleteIcon /> DELETE
            </Button>
            <Button
              variant="outline"
              className={`${styles["buttons"]} ${styles["add-btn"]}`}
            >
              <AddIcon fill="#4B4B4B" /> ADD
            </Button>
            {/* <IconButton
              buttonProps={{ variant: "outline", round: "flat" }}
              icon={<CopyIcon />}
              iconText={"DUPLICATE"}
              className={styles["buttons"]}
            ></IconButton>
            <IconButton
              buttonProps={{ variant: "outline", round: "flat" }}
              icon={<DeleteIcon />}
              iconText={"DELETE"}
              className={styles["buttons"]}
            ></IconButton>
            <IconButton
              buttonProps={{ variant: "outline", round: "flat" }}
              icon={<AddIcon />}
              iconText={"ADD"}
              className={styles["buttons"]}
            ></IconButton> */}
          </div>
        </div>
        <DataGrid.Header
          columns={headerColumns}
          className={`${styles["data-grid-header"]}`}
        />
        <DataGrid
          columns={columns}
          rows={rows}
          className={`${styles["data-grid"]}`}
        />
      </Card>
    </div>
  );
};
export default Server;
